import React from "react";
import TablaProveedor from "./componentes/TablaProveedor";
import { Plus } from "lucide-react";

function Proveedores() {
  return (
    <div className="w-screen pt-4">
      <TablaProveedor />
      <a href="/productos/agregar">
        <div className="bg-blue-400 w-fit p-2 rounded-full">
          <Plus className="w-7 h-7 text-slate-200" />
        </div>
      </a>
    </div>
  );
}

export default Proveedores;
